import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class DocauthService {

  constructor() { }
  authenticate(username:string,password:string){
        if(username==='doctor' && password==='doc@123'){
              sessionStorage.setItem('authenticaterDoctor',username)
              return true;
        }
        else{
              return false;
        }
  }
}
